<?php

namespace App\Http\Controllers;

use App\Models\Allocation;
use App\Models\Transaction;
use App\Models\User;
use Illuminate\Http\Request;
use Illuminate\Support\Facades\Auth;
use Validator;

class TransactionController extends Controller
{
    /**
     * Display a listing of the resource.
     *
     * @return \Illuminate\Http\Response
     */
    public function index()
    {
        $transactions = Transaction::all();
        return view('transactions.transactions', compact('transactions'));
    }

    /**
     * Show the form for creating a new resource.
     *
     * @return \Illuminate\Http\Response
     */
    public function create()
    {
        $users = User::where('allocation','=','Allocation')
        ->orWhere('allocation','Director')
        ->orWhere('allocation','VIP')
        ->get();

        return view('transactions.create-transaction', compact('users'));
    }

    /**
     * Store a newly created resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @return \Illuminate\Http\Response
     */
    public function store(Request $request) {
        $tdate = date('Ymd');
        $tletter = chr(64+rand(0,26));
        $ttime = date('His');

        $trans_code = 'T'.$tdate.'.'.$tletter.$ttime;
        $request->merge([
            'trans_code' => $trans_code,
            'created_at' => $request->input('created_at')
        ]);

        $validator = Validator::make($request->all(),
            [
                'trans_code'                  => 'required|max:255|unique:transactions',
                'employee'                  => 'required|max:255',
                'voucher'                  => 'required|max:255|unique:transactions',
                'ftype'                  => 'required|max:255',
                'meter_start'                  => 'required|max:255',
                'meter_stop'                  => 'required|max:255',
                'quantity'                  => 'required|max:255',
                'reg_num'                  => 'required|max:255',
                'done_by'                  => 'required|max:255',
                'amount'                  => 'required|max:255',
            ],
            [
                'trans_code.unique'       => 'Transaction code has to be unique. Please wait a bit before trying again.',
                'trans_code.required'       => 'Somehow the transaction code was not generated',
                'employee.required'       => 'Whose allocation is this? Paynumber?',
                'voucher.unique'       => 'We need a unique voucher number for this transaction',
                'voucher.required'       => 'We need a voucher number for this transaction',
                'ftype.required'       => 'What type of fuel was this?',
                'meter_start.required'       => 'What was the initial meter reading before this transaction?',
                'meter_stop.required'       => 'What was the meter reading after the transaction was done?',
                'quantity.required'       => 'How much fuel was issued out?',
                'reg_num.required'       => 'What was the reg number of the vehicle issued into?',
                'done_by.required'       => 'Please ensure that you\'re logged in',
                'amount.required'                  => 'How much amount for the fuel was issued out ?',
            ]
        );

        if ($validator->fails()) {
            return back()->withErrors($validator)->withInput();
        }

        $employee = User::where('paynumber','=',$request->input('employee'))->firstOrFail();

        if ($employee->allocation == 'Director' OR $employee->allocation == 'VIP') {
            $remaining = $employee->alloc_size - $request->input('quantity');
            $employee->alloc_size = $remaining;
            $employee->save();

            $transaction = Transaction::create([
                'trans_code'             => $request->input('trans_code'),
                'employee'             => $request->input('employee'),
                'voucher'             => $request->input('voucher'),
                'allocation'             => 'Director Allocation',
                'ftype'             => $request->input('ftype'),
                'meter_start'             => $request->input('meter_start'),
                'meter_stop'             => $request->input('meter_stop'),
                'quantity'             => $request->input('quantity'),
                'reg_num'             => $request->input('reg_num'),
                'done_by'             => $request->input('done_by'),
                'created_at'             => $request->input('created_at'),
                'amount'       => $request->input('amount'),
            ]);

            $transaction->save();

            return redirect('transactions')->with('success', 'Transaction recorded.');
        }

        $allocation = Allocation::where('allocation', $request->input('allocation'))->firstorfail();
        if ($allocation->balance == NULL) {
            if ($request->input('quantity') <= $allocation->alloc_size) {
                $remaining = $allocation->alloc_size - $request->input('quantity');
                $allocation->balance = $remaining;
                $allocation->save();
            } else {
                return back()->with('error', 'Fuel requested is more than the allocation available balance.');
            }
        } else{
            if ($request->input('quantity') <= $allocation->balance) {
                $remaining = $allocation->balance - $request->input('quantity');
                $allocation->balance = $remaining;
                $allocation->save();
            } else {
                return back()->with('error', 'Fuel requested is more than the allocation available balance.');
            }
        }

        //dd('doing good g');
        $transaction = Transaction::create([
            'trans_code'             => $request->input('trans_code'),
            'employee'             => $request->input('employee'),
            'voucher'             => $request->input('voucher'),
            'allocation'             => $request->input('allocation'),
            'ftype'             => $request->input('ftype'),
            'meter_start'             => $request->input('meter_start'),
            'meter_stop'             => $request->input('meter_stop'),
            'quantity'             => $request->input('quantity'),
            'reg_num'             => $request->input('reg_num'),
            'done_by'             => $request->input('done_by'),
            'created_at'             => $request->input('created_at'),
            'amount'       => $request->input('amount'),
        ]);

        $transaction->save();

        return redirect('transactions')->with('success', 'Transaction recorded.');
    }

    /**
     * Display the specified resource.
     *
     * @param  \App\Models\Transaction  $transaction
     * @return \Illuminate\Http\Response
     */
    public function show(Transaction $transaction)
    {
        return view('transactions.show-transaction', compact('transaction'));
    }

    /**
     * Show the form for editing the specified resource.
     *
     * @param  \App\Models\Transaction  $transaction
     * @return \Illuminate\Http\Response
     */
    public function edit(Transaction $transaction)
    {
        $users = User::all()->where('allocation','=','Allocation');

        return view('transactions.edit-transaction', compact('transaction', 'users'));
    }

    /**
     * Update the specified resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @param  \App\Models\Transaction  $transaction
     * @return \Illuminate\Http\Response
     */
    public function update(Request $request, Transaction $transaction)
    {
        $validator = Validator::make($request->all(),
            [
                'employee'   => 'required|max:255',
                'voucher'    => 'required|max:255|unique:transactions,voucher,'.$transaction->id,
                'ftype'      => 'required|max:255',
                'meter_start'=> 'required|max:255',
                'meter_stop' => 'required|max:255',
                'quantity'   => 'required|max:255',
                'reg_num'    => 'required|max:255',
                'amount'     => 'required|max:255',
            ],
            [
                'employee.required'       => 'Whose allocation is this? Paynumber?',
                'voucher.unique'       => 'We need a unique voucher number for this transaction',
                'voucher.required'       => 'We need a voucher number for this transaction',
                'ftype.required'       => 'What type of fuel was this?',
                'meter_start.required'       => 'What was the initial meter reading before this transaction?',
                'meter_stop.required'       => 'What was the meter reading after the transaction was done?',
                'quantity.required'       => 'How much fuel was issued out?',
                'reg_num.required'       => 'What was the reg number of the vehicle issued into?',
                'amount.required'        => 'How much amount for the fuel was issued out ?',
            ]
        );

        if ($validator->fails()) {
            return back()->withErrors($validator)->withInput();
        }

        $employee = User::where('paynumber','=',$request->input('employee'))->firstOrFail();

        if ($employee->allocation == 'Director') {
            if ($transaction->quantity != $request->input('quantity')){
                $orgQuant = $transaction->quantity + $employee->alloc_size;

                $remaining = $orgQuant - $request->input('quantity');
                $employee->alloc_size = $remaining;
                $employee->save();
            }

            $transaction->employee = $request->input('employee');
            $transaction->voucher = $request->input('voucher');
            $transaction->ftype = $request->input('ftype');
            $transaction->meter_start = $request->input('meter_start');
            $transaction->meter_stop = $request->input('meter_stop');
            $transaction->reg_num = $request->input('reg_num');
            $transaction->amount = $request->input('amount');
            $transaction->updated_at = now();

            $transaction->save();

            return redirect('transactions')->with('success', 'Transaction updated successfully.');
        }

        $allocation = Allocation::where('allocation', $request->input('allocation'))->firstorfail();
        if ($transaction->quantity != $request->input('quantity')) {

            if ($allocation->balance == 0) {
                if ($request->input('quantity') <= $allocation->alloc_size) {
                    $orgQuant = $transaction->quantity;

                    if ($request->input('quantity') > $orgQuant) {
                        $remaining = $orgQuant - $request->input('quantity');
                        $allocation->balance = $remaining;
                        $allocation->save();
                    } else{
                        return back()->with('error', 'Fuel requested is more than the allocation available balance.');
                    }
                } else {
                    return back()->with('error', 'Fuel requested is more than the allocation available balance.');
                }
            } else {
                if ($request->input('quantity') <= $allocation->balance) {
                    $orgQuant = $transaction->quantity + $allocation->balance;

                    $remaining = $orgQuant - $request->input('quantity');
                    $allocation->balance = $remaining;
                    $allocation->save();
                } else {
                    return back()->with('error', 'Fuel requested is more than the allocation available balance.');
                }
            }
        }

        $transaction->employee = $request->input('employee');
        $transaction->voucher = $request->input('voucher');
        $transaction->allocation = $request->input('allocation');
        $transaction->ftype = $request->input('ftype');
        $transaction->meter_start = $request->input('meter_start');
        $transaction->meter_stop = $request->input('meter_stop');
        $transaction->quantity = $request->input('quantity');
        $transaction->reg_num = $request->input('reg_num');
        $transaction->amount = $request->input('amount');
        $transaction->updated_at = now();

        $transaction->save();

        return back()->with('success', 'Transaction updated successfully.');
    }

    /**
     * Remove the specified resource from storage.
     *
     * @param  \App\Models\Transaction  $transaction
     * @return \Illuminate\Http\Response
     */
    public function destroy(Transaction $transaction) {
        $transaction->delete();
        return redirect('transactions')->with('success', 'Successfully deleted transaction.');
    }

    public function generatePdf($id){

        $transaction = Transaction::findorFail($id);

        try {
            $mpdf = new \Mpdf\Mpdf([
                'margin_left' => 10,
                'margin_right' => 10,
                'margin_top' => 48, //48
                'margin_bottom' => 25,
                'margin_header' => 10, //10
                'margin_footer' => 10,
            ]);

            $html = \View::make('transactions.receipt' )->with('transaction', $transaction);
            $html = $html->render();

            $mpdf->SetProtection(array('print'));
            $mpdf->SetTitle("Whelson Transaction Receipt");
            $mpdf->SetAuthor("Vincent H Guyo");
            $mpdf->SetWatermarkImage(url('data:image/png;base64,'));
            $mpdf->showWatermarkImage = true;
            $mpdf->watermark_font = 'DejaVuSansCondensed';
            $mpdf->watermarkTextAlpha = 0.1;
            $mpdf->SetDisplayMode('fullpage');
            $mpdf->WriteHTML($html);
            $mpdf->Output("WhelsonReceipt".$transaction->employee.'.pdf', 'I');
            return redirect()->back();
        } catch (\Mpdf\MpdfException $e) { // Note: safer fully qualified exception name used for catch
            // Process the exception, log, print etc.
            echo $e->getMessage();

        }
    }

    public function myTransactions(){
        $transactions = Transaction::where('employee','=', Auth::user()->paynumber)->get();
        return view('transactions.mytransactions', compact('transactions'));
    }

    public function currentTransactions(){
        $transactions = Transaction::whereMonth('created_at', date('m'))
            ->whereYear('created_at', date('Y'))
            ->get();
        return view('transactions.current-trans', compact('transactions'));
    }
}
